import request from '@/utils/request';
export function queryRecords(query) {
  //查询
  return request({
    url: "/mes/process/steps",
    method: 'get',
    params: query
  });
} // 查询设备列表

export function getEquipmentAll(query) {
  return request({
    url: "/mes/equipmentLedger",
    method: 'get',
    params: query
  });
}
export function equipmentType() {
  //查询设备类别
  return request({
    url: "/mes/equipmentType",
    method: 'get'
  });
}
